'Action commissions'=>'Δράση προμήθειες',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Το χαρακτηριστικό Δράση προμήθειες σας επιτρέπει να ορίσετε προμήθειες ανά δράση, ή ανά "οτιδήποτε".<br/>Με αυτόν τον τρόπο μπορείτε να ορίσετε προμήθειες για παράδειγμα ανά εγγραφή χρήστη, ανά λήψη, ανά επίσκεψη συγκεκριμήνης σελίδας, κτλ.<br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας</a>',
'More help in our Knowledge Base'=>'Περισσότερη βοήθεια στη Βάση Γνώσεών μας',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Banner σε περιστροφή είναι ένας ειδικός τύπος banner που περιστρέφει άλλα banners.<br/>Όταν ο θυγατρικός εισάγει περιστροφή στη σελίδα του, η περιστροφή προβάλλει banners που είναι συνδεδεμένα με την περιστροφή, ώστε ο επισκέπτης να βλέπει ένα άλλο banner κάθε φορά που επισκέπτεται τη σελίδα θυγατρικών.<br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας.</a>',
'Branding free'=>'Ελεύθερο Branding ',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Ελεύθερο Branding είναι ένα ειδικό χαρακτηριστικό που σας επιτρέπει να να αλλάζετε τους συνδέσμους στο υποσέλιδο των πάνελ και στις φόρμες εγγραφής από "Powered by %s" στο δικό σας κείμενο και σύνδεσμο.<br/><a href="%s" target="_blank">Πεισσότερη βοήθεια στη Βάση Γνώσεών μας.</a>',
'Commission Groups'=>'Ομάδες προμήθειας',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Ομάδες προμήθειας σας επιτρέπει να ορίζετε διαφορετικές προμήθειες για διαφορετικούς χρήστες για την ίδια καμπάνια.<br/><a href="%s" target="_blank">Πεισσότερη βοήθεια στη Βάση Γνώσεών μας. </a>',
'CPM commissions'=>'Προμήθειες CPM ',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Προμήθειες CPM (κόστος τοις χιλίοις) είναι ένας ειδικός τύπος προμηθειών που ανταμείβονται για 1000 Εμφανίσεις, το οποίο σημαίνει για την προβολή των banners σας 1000 φορές.<br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας.</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Forced matrix σας επιτρέπει να περιορίζετε τον αριθμό παραπομπών υποθυγατρικών που κάθε θυγατρικός μπορεί να παραπέμψει. Αυτό σημαίνει ότι κάθε θυγατρικός έχει μόνο συγκεκριμένο αριθμό παιδιών. <a href="%s" target="_blank">Περισσότερες λεπτομέρειες διαβάστε στη Βάση Γνώσεών μας.</a>',
'Hosting of %s on  %s servers.'=>'Φιλοξενία σε %s σε %s διακομιστές.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Πολλαπλά νοσμίσματα σας επιτρέπει να παρακολουθείτε πωλήσεις σε πολλαπλά νομίσματα.<br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας</a>',
'Multiple merchants'=>'Πολλαπλοί έμποροι',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Εξ ορισμού, όλες οι καμπάνιες σε %s είναι δημόσιες, το οποίο σημαίνει ότι όλοι οι θυγατρικοί μπορούν να τις δουν και να τις προωθήσουν. Το χαρακτηριστικό ιδιωτικές καμπάνιες σας επιτρέπει να δημιουργείτε ιδιωτικές καμπάνιες, οι οποίες θα είναι ορατές μόνο σε επιλεγμένους θυγατρικούς.<br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Σας επιτρέπει να δημιουργείτε έναν ειδικό τύπο εργαλείων promo - rebrandable e-books. Μπορείτε να δημιουργήσετε το PDF e-book σας μόνο μια φορά και να το φορτώσετε σε %s.Οι θυγατρικοί σας θα πάρουν αυτόματα το δικό τους re-branded cαντίγραφο του βιβλίου, με το όνομά τους, συνδέσμους θυγατρικού, κείμενα, κτλ. Δεν είανι ανάγκη να εκτελείται κάποιο πρόγραμμα Windows για branding, αυτοί απλά θα κατεβάσουν το rebranded PDF. Όλα τα rebranding έχουν φτιαχτεί αυτόματα στο φόντο. <br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Επαναλαμβανόμενες προμήθειες σας επιτρέπουν να ανταμοίβετε του θυγατρικούς σας για επαναλαμβανόμενες πληρωμές, για παράδειγμα για φολιξενία ή ιδιότητα μέλους. <br/><a href="%s" target="_blank">Περισσότερη βοήθεια στη Βάση Γνώσεών μας. </a>',
