'Auto approval commissions'=>'Αυτόματη έγκριση προμηθειών',
'Plugin will add to menu Tools new item "Database status", under which you can view database tables of %s. Information about database tables includes e.g. table names, table size, number of rows in each table. You can execute on tables database operations like Analyze table, Optimize table or Repair table. After activation of this plugin you need to reload application in browser to see changes in menu!'=>'Plugin θα προσθέσει στο μενού Εργαλεία νέο στοιχείο "Κατάσταση Βάσης δεδομένων", κάτω από το οποίο μπορείτε να δείτε πίνακες δεδομένων του %s. Πληροφορίες σχετικά με πίνακες δεδομένων περιλαμβάνουν π.χ. ονόματα πινάκων, μέγεθος πίνακα, αριθμό σειρών σε κάθε πίνακα. Μπορείτε να εκτελέσετε σε λειτουργίες πινάκων βάσης δεδομένων όπως Ανάλυση πίνακα, Βελτιστοποίηση πάνακα ή Επισκευή πίνακα. Μετά την ενεργοποίηση αυτού του plugin πρέπει να επαναφορτώσετε την εφαρμογή στο πρόγραμμα περιήγησης διαδικτύου για να δείτε τις αλλαγές στο μενού!',
