'Custom value separator should be set only when custom value is used by other script. See GoogleCheckout (custom value used by other script) integration method.'=>'Διαχωριστής προσαρμογή τιμής θα πρέπει να ρυθμίζετε μόνο όταν η προσαρμοσμένη τιμή χρησιμοποιείται από άλλη γραμμή εντολών. Δείτε μέθοδο ένταξης GoogleCheckout (προσαρμοσμένη τιμή χρησιμοποιείται από άλλη γραμμή εντολών).',
